
-- Table 1: Companies / Stocks
CREATE TABLE IF NOT EXISTS stocks (
    stock_id SERIAL PRIMARY KEY,
    identifier TEXT UNIQUE NOT NULL,
    company_name TEXT NOT NULL,
    industry_name TEXT,
    sector_name TEXT,
    market_cap NUMERIC
);

-- Table 2: Factor Scores (per stock per fiscal year)
CREATE TABLE IF NOT EXISTS factor_scores (
    id SERIAL PRIMARY KEY,
    stock_id INT REFERENCES stocks(stock_id) ON DELETE CASCADE,
    fiscal_year TEXT NOT NULL,
    score NUMERIC CHECK (score >= 0),
    UNIQUE(stock_id, fiscal_year)
);

-- Table 3: Price Returns (per stock per fiscal year)
CREATE TABLE IF NOT EXISTS price_returns (
    id SERIAL PRIMARY KEY,
    stock_id INT REFERENCES stocks(stock_id) ON DELETE CASCADE,
    fiscal_year TEXT NOT NULL,
    return_pct NUMERIC,
    UNIQUE(stock_id, fiscal_year)
);

-- Table 4: Detailed Backtest (top 20 stocks selected each year)
CREATE TABLE IF NOT EXISTS detailed_backtest (
    id SERIAL PRIMARY KEY,
    selection_fy TEXT NOT NULL,
    return_fy TEXT NOT NULL,
    stock_id INT REFERENCES stocks(stock_id) ON DELETE CASCADE,
    score NUMERIC,
    return_pct NUMERIC
);

-- Table 5: Portfolio Backtest Results (aggregated portfolio performance)
CREATE TABLE IF NOT EXISTS portfolio_backtest (
    id SERIAL PRIMARY KEY,
    selection_fy TEXT NOT NULL,
    return_fy TEXT NOT NULL,
    num_stocks INT,
    portfolio_return_pct NUMERIC
);


